import React from "react";
import { Link } from "react-router-dom";
import "./css/nav.css";
function Nav() {
  return (
    <div className="nav">
      <div id="nn">
        <h4>GAMING HUB</h4>
      </div>
      <div>
        <ul>
          <Link to="/home">HOME</Link>
        </ul>
      </div>
    </div>
  );
}
export default Nav;
